import React from 'react';
import styles from '../styles/Home.module.css'


const Footer = () => {
    return (
        <div>
            <footer className={styles.footer}>

          &#169; Luke Myers 2020{' '}

          <div><p></p></div>
          <div className={styles.reactLogo}><span class="react-logo"><span class="nucleo"></span></span></div>            

      </footer>
    </div>


    );
};

export default Footer;
